import React from 'react';


function Card ({ pokemon}) {
    return (
        <div>
            <div>
                <img src={pokemon.sprites.front_default}/>
            </div>
            <div>
                {pokemon.name}
            </div>
            <div>
                {pokemon.type.map(type => {
                    return (
                        <div>
                            {type.type.name}
                        </div>
                    )
                })}
            </div>
            <div></div>
        </div>
    )
}
export default Card;
